INSERT INTO `product` VALUES (1,'Pantalones deportivos del Real Madrid inspirados en el legado de adidas y hechos parcialmente con materiales reciclados',_binary '\0','Pantalón Deportivo Real Madrid Originals',119999,20,1,1,_binary '\0'),(2,'Pantalones deportivos cómodos con un look de inspiración retro',_binary '','Pantalón Adicolor 70s',97999,30,1,1,_binary ''),(3,'Una remera de running ligera diseñada para ayudarte a llegar lejos.',_binary '\0','Remera Adizero Running',79997,50,2,1,_binary '\0'),(4,'Expandí los límites de tu carrera con una remera de running ligera.',_binary '','Remera Own the Run 3 Tiras',60000,60,2,1,_binary '\0'),(5,'Un buzo con capucha para pasar el día con comodidad.',_binary '\0','Buzo con Capucha Adicolor Classics Trifolio',121000,10,3,1,_binary '\0'),(7,'La tecnología Heatgear es un tejido súper transpirable que absorbe el sudor y regula la temperatura del cuerpo para que te sientas más fresco, seco y ligero que nunca. Logo Under Armour estampado.',_binary '\0','Remera Under Armour Entrenamiento',59999,100,2,1,_binary '\0'),(8,'Viví la pasión por boca con la nueva equipación en entrenamiento ADIDAS. El tejido Aeroready favorece el secado rápido, ya que al ser un tejido ultraligero, absorbe el sudor para alejarlo de la piel y hacer que se evapore rápidamente. Buzo medio cierre. Logo ADIDAS estampado. Escudo CABJ estampado.',_binary '','Buzo De Boca Medio Cierre Adidas',199999,100,3,1,_binary '\0'),(9,'No importa si los estás anotando o parando, el deporte rey se trata de goles. Estos botines adidas Goletto VIII lucen un exterior sintético moderno que incorpora puntadas en antepié para un mayor control y un cómodo acolchado en el talón. La suela de caucho con tapones se adhiere al pasto sintético para ayudarte a brillar. Hechos parcialmente con contenido reciclado generado a partir de desechos de producción, tales como recortes de tela y desechos domésticos postconsumo, para evitar un mayor impacto ambiental al producir contenido virgen.',_binary '\0','Botines De Futbol Adidas Goletto',78997,10,4,1,_binary '\0'),(10,'Cuando jugás con la misma intensidad que Boca Juniors, descansar es clave. Cuando las estrellas de La Bombonera se relajan, usan shorts como estos. La tecnología de absorción AEROREADY mantiene tu cuerpo seco todo el tiempo que necesites. La cintura elástica con cordón permite un ajuste perfecto. Hecho con materiales 100% reciclados, este producto representa solo una de nuestras soluciones para acabar con los residuos plásticos. Cintura elastizada con cordón de ajuste. Bolsillos laterales con cierre. Logo ADIDAS bordado. Escudo CABJ aplicado.',_binary '\0','Short De Boca Adidas Descanso',39999,37,6,1,_binary '\0'),(12,'Dimensiones aproximadas Largo: 52 cm. Ancho: 28 cm. Alto: 29 cm. Amplio compartimiento principal con cierre. Bolsillos laterales con cierre. Bolsillo frontal con cierre. Tira con ajuste regulable y desmontable. Asas para transporte azules. Logo GILBERT estampado.',_binary '\0','Bolso Gilbert Player Holdall',99999,60,7,1,_binary '\0'),(14,'Completá tus entrenamientos con HEAD.',_binary '','Zapatillas De Entrenamiento Head Austin',299999,20,4,1,_binary '\0'),(19,'Sentí frescura bajo presión.\\nConfeccionada con adidas AIRCHILL, esta musculosa maximiza el flujo de aire desde todas las direcciones mientras que la tecnología HEAT.RDY ayuda a mantener el calor y la humedad a raya.\\nEsta musculosa adidas te permite moverte con fluidez en la cancha o concentrarte en el golpe ganador.\\nGracias a su sensación de ligereza y frescura, no perderás de vista tu concentración, a pesar de que el sol del mediodía cae y el partido está en su punto.\\nEste producto está hecho con materiales 100% reciclados.\\nUtilizando materiales reciclados disminuimos los residuos, nuestra dependencia de los recursos finitos y la huella que generan los productos que fabricamos.\\nLogo ADIDAS estampado.',_binary '\0','Musculosa De Tenis Adidas Pro',69999,77,2,1,_binary '\0');
/*!40000 ALTER TABLE `product` ENABLE KEYS */;
